$("document").ready(function(){$(function(){$("#choose-a-section").on("change",function(){var t=$(this).val();""===t&&console.log(t),$.ajax({method:"GET",url:"https://api.nytimes.com/svc/topstories/v2/"+t+".json?api-key=xisDLGyNhtkY6svtpYW6sxQDUGGwj4IO"}).done(function(t){for(var a=t.results.filter(function(t){return t.multimedia.length>3}).splice(0,12),e="<ul>",s=0;s<a.length;s++){var i=a[s],n=i.abstract,l=i.multimedia[4].url,o='<a href="'+i.url+'" target="_blank">';o+='<div class="article" style="background-image:url('+l+')">',o+='<div class="abstract">'+n+"</div>",o+="</div>",e+=o+="</a>"}e+="</ul>",$(".results").empty().append(e)})})})});